import React from 'react'
import './ask.css';

export default function Questions() {
  function submitForm() {
    alert("jiofa");
  }
  return (
    <div className='ask'>
      <form onSubmit={submitForm}>
      <label>
        Title:
        <input type="text" name="title" />
      </label>
      <label>
        Content:
        <input type="text" name="content" />
      </label>
      </form>
    </div> 
  )
}
